#
# Structure for table "shopping_order"
#

DROP TABLE IF EXISTS `shopping_order`;
CREATE TABLE `shopping_order` (
  `user_id` int(10) unsigned zerofill NOT NULL COMMENT '用户id',
  `good_id` int(10) unsigned zerofill NOT NULL COMMENT '商品id',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '订单提交时间',
  `order_status` int(11) NOT NULL COMMENT '订单状态',
  `good_price` int(11) NOT NULL COMMENT '商品价格',
  `counts` int(11) NOT NULL COMMENT '商品数量',
  PRIMARY KEY (`user_id`,`good_id`),
  KEY `good_id` (`good_id`),
  CONSTRAINT `shopping_order_ibfk_1` FOREIGN KEY (`good_id`) REFERENCES `good` (`good_id`),
  CONSTRAINT `shopping_order_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `user` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

